IF NOT EXISTS (SELECT name FROM master.dbo.sysdatabases WHERE name = 'HRManagement')
BEGIN
    CREATE DATABASE HRManagement;
END
GO

-- Use HRManagement
USE HRManagement;
GO

-- Create PersonnelManagement schema
IF NOT EXISTS (SELECT 1 FROM INFORMATION_SCHEMA.SCHEMATA WHERE SCHEMA_NAME = 'PersonnelManagement')
BEGIN
    EXEC('CREATE SCHEMA PersonnelManagement');
END
GO

DROP TABLE [PersonnelManagement].[Employee];
GO

DROP TABLE [PersonnelManagement].[Role];
GO

-- Create Role table
CREATE TABLE [PersonnelManagement].[Role]
(
    Id TINYINT PRIMARY KEY NOT NULL,
    Name NVARCHAR(MAX),
    ReportsToId TINYINT,
    FOREIGN KEY (ReportsToId) REFERENCES [PersonnelManagement].[Role] (Id)
    );
CREATE INDEX IX_Role_ReportsToId ON [PersonnelManagement].[Role] (ReportsToId);
GO

-- Create Employee table
CREATE TABLE [PersonnelManagement].[Employee]
(
    Id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
    FirstName NVARCHAR(MAX),
    LastName NVARCHAR(MAX),
    Email NVARCHAR(MAX),
    DateOfBirth DATE NOT NULL,
    HireDate DATE NOT NULL,
    TerminationDate DATE,
    RoleId TINYINT DEFAULT (CONVERT([TINYINT],(0))) NOT NULL,
    ManagerId UNIQUEIDENTIFIER,
    FOREIGN KEY (RoleId) REFERENCES [PersonnelManagement].[Role] (Id),
    FOREIGN KEY (ManagerId) REFERENCES [PersonnelManagement].[Employee] (Id)
    );
CREATE INDEX IX_Employee_ManagerId ON [PersonnelManagement].[Employee] (ManagerId);
CREATE INDEX IX_Employee_RoleId ON [PersonnelManagement].[Employee] (RoleId);
GO


